import { HeaderStyled } from "./styles";
import { Link } from "react-router-dom";
import logoWithoutName from "../../assets/Images/logoWithoutName.png";
import { useAuth } from "../../providers/Authentication";
import { VscAccount } from "react-icons/vsc";
function Header() {
  const { authToken, logout } = useAuth();

  return (
    <HeaderStyled>
      <div className="lastBox">
        {authToken === "" ? (
          <div className="notLogged">
            <div className="image-container">
              <Link className="LinkImageLINK" to="/">
                <img
                  className="LinkImage"
                  src={logoWithoutName}
                  alt="botão da home page"
                />
              </Link>
            </div>
            <Link className="Link" to="/imoveis">
              Imoveis
            </Link>
            <Link className="Link" to="/registrar">
              Registro
            </Link>
            <Link className="Link" to="/login">
              Login
            </Link>
          </div>
        ) : (
          <div className="Logged">
            <Link className="LinkImageLINK" to="/">
              <img
                className="LinkImage"
                src={logoWithoutName}
                alt="botão da home page"
              />
            </Link>
            <Link className="Link" to="/imoveis">
              Imoveis
            </Link>
            <Link
              className="Link"
              to=""
              onClick={() => {
                logout();
              }}
            >
              Logout
            </Link>
            <Link className="Link" to="/perfil">
              <VscAccount className="LinkFont" />
            </Link>
          </div>
        )}
      </div>
    </HeaderStyled>
  );
}

export default Header;
